import React from 'react';
import styled from 'styled-components';

const colors = {
  1: '#ff5733',  // Red
  2: '#33ff57',  // Green
  3: '#3357ff',  // Blue
  4: '#ff33a8',  // Pink
  5: '#33fff7',  // Cyan
  6: '#ffbd33',  // Orange
  7: '#bd33ff',  // Purple
  8: '#ff3333',  // Dark Red
  9: '#33ffbd'   // Mint
};

const TileContainer = styled.div`
  width: 100px;
  height: 100px;
  background-color: #8a2be2;
  clip-path: polygon(50% 0%, 100% 25%, 100% 75%, 50% 100%, 0% 75%, 0% 25%);
  display: grid;
  grid-template-areas:
    "top top"
    "left right"
    "bottom bottom";
  color: white;
  font-weight: bold;
  cursor: pointer;
`;

const NumberTop = styled.div`
  grid-area: top;
  justify-self: center;
  align-self: start;
  background-color: ${props => colors[props.value]};
`;

const NumberLeft = styled.div`
  grid-area: left;
  justify-self: start;
  align-self: center;
  background-color: ${props => colors[props.value]};

`;

const NumberRight = styled.div`
  grid-area: right;
  justify-self: end;
  align-self: center;
  background-color: ${props => colors[props.value]};

`;

function Tile({ values, onClick }) {
  return (
    <TileContainer onClick={onClick}>
      <NumberTop value={values[0]}>{values[0]}</NumberTop>
      <NumberLeft value={values[1]}>{values[1]}</NumberLeft>
      <NumberRight value={values[2]}>{values[2]}</NumberRight>
    </TileContainer>
  );
}

export default Tile;
